export default function() {
  return [
    {
      type: "Item",
      title: "Registrar Sistema",
      to: "/register-system",
      htmlBefore: '<i class="material-icons">edit</i>',
      htmlAfter: ""
    },
    {
      type: "Item",
      title: "Pesquisar Sistema",
      to: "/get-system",
      htmlBefore: '<i class="material-icons">edit</i>',
      htmlAfter: ""
    }
  ];
}
